import {Link} from "react-router-dom"
import React, { useState , Component, props} from 'react';
import './css/StudentProjectForm.css'

function StudentProjectForm(){
    const [name, setName] = useState("");
    const [ddl1, setDdl1] = useState("");
    const [ddl2, setDdl2] = useState("");
    const [ddl3, setDdl3] = useState("");
    const [tm1, setTM1] = useState("");
    const [tm2, setTM2] = useState("");
    const [tm3, setTM3] = useState("");   

    const[link1, setLink1] = useState("");
    const[link2, setLink2] = useState("");
    const[link3, setLink3] = useState("");
   
    const handleSubmit = (event) => {
        event.preventDefault();
        alert('You have submited the project form')
    }

    const handleSubmitLink1 = (event) => {
        event.preventDefault();
        alert('You have submited the project for the first deadline')
    }

    const handleSubmitLink2 = (event) => {
        event.preventDefault();
        alert('You have submited the project for the second deadline')
    }

    const handleSubmitLink3 = (event) => {
        event.preventDefault();
        alert('You have submited the project for final deadline')
    }

    const displayForm=()=> {
        console.log('lala')
        return(
            <div>
                
            </div>
        )
    }

    const [data, setData] = React.useState(null);

    return (
        <>
            <div className="container">
            
            <form onSubmit={handleSubmit}>
                
                <label>Project name
                    <input type="text"
                    value={name}
                    onChange={(e) => setName(e.target.value)}/>
                </label>
                <br/>
                <label>Team member 1
                    <input type="text"
                    value={tm1}
                    onChange={(e) => setTM1(e.target.value)}/>
                </label>
                <br/>
                <label>Team member 2
                    <input type="text"
                    value={tm2}
                    onChange={(e) => setTM2(e.target.value)}/>
                </label>
                <br/>
                <label>Team member 3
                    <input type="text"
                    value={tm3}
                    onChange={(e) => setTM3(e.target.value)}/>
                </label>
                <br/>
                <label>Deadline 1
                    <input type="text"
                    value={ddl1}
                    onChange={(e) => setDdl1(e.target.value)}/>
                </label>
                <br/>
                <label>Deadline 2
                    <input type="text"
                    value={ddl2}
                    onChange={(e) => setDdl2(e.target.value)}/>
                </label>
                <br/>
                <label>Deadline 3
                    <input type="text"
                    value={ddl3}
                    onChange={(e) => setDdl3(e.target.value)}/>
                </label>
                <br/>
                <button type="submit">Submit</button>
                                           
            </form>

            <div className="ddl1">
                Submit the link for the first deadline
                    <form onSubmit={handleSubmitLink1}>
                        <label>Deadline 1
                            <input type="text"
                            value={link1}
                            onChange={(e)=> setLink1(e.target.value)}/>
                        </label>
                        <br/>
                        <button type="submit">Submit</button>
                    </form>
            </div>

            <div className="ddl2">
                Submit the link for the second deadline
                    <form onSubmit={handleSubmitLink2}>
                        <label>Deadline 2
                            <input type="text"
                            value={link2}
                            onChange={(e)=> setLink2(e.target.value)}/>
                        </label>
                        <br/>
                        <button type="submit">Submit</button>
                    </form>
            </div>

            <div className="ddl3">
                Submit the link for the final deadline
                    <form onSubmit={handleSubmitLink3}>
                        <label>Deadline 3
                            <input type="text"
                            value={link3}
                            onChange={(e)=> setLink3(e.target.value)}/>
                        </label>
                        <br/>
                        <button type="submit">Submit</button>
                    </form>
            </div>  
            </div>  
        </>
    )
    }

export default StudentProjectForm
